import { Navbar, NavItem, Wrapper } from './components'




class App extends React.Component {
	render() {
	return(
		<Wrapper>
			<Navbar position='fixed' width='400px' height='100vh' background='black'>
				<NavItem>hello</NavItem>

			</Navbar>
		</Wrapper>
	);
	}
}

export default App;
